#include <iostream>
#include <vector>
#include <algorithm>
#include <set>
#include <cmath>
#include <map>
#include <iomanip>
//#include <bits>
using namespace std;
const int MAXN = 1e5;
long long int ar [ MAXN ];
int binarysearch( int st , int ed, int num)
{
	if(ed - st < 1)
		return st + 1;
	int mid = (st + ed)/2;
	if(num > ar [ mid ])	
		return binarysearch(mid + 1 , ed , num);
	return binarysearch(st , mid , num)	;
}
int main() {
	ios::sync_with_stdio(false) , cin.tie(0) , cout.tie(0);
	int n , m;
	cin >> n;
	cin >> ar [ 0 ];
	for(int i = 1 ; i < n ; i++)
	{
		cin >> ar [ i ];
		ar [ i ] += ar [i - 1 ];
	}	
	cin >> m;
	for(int i = 0 ; i < m ; i++)
	{
		int a;
		cin >> a;
		cout << binarysearch(0, n, a) << endl;
	}	
}